    .SYNOPSIS
    Backs up content to a compressed archive
    .DESCRIPTION
    the script will use 7-zip to compress a folder to a zip or 7z file archive
    .PARAMETER Target
    Specify what is getting backedup
    .PARAMETER Destination
    Specify where the backup file will be stored
    .PARAMETER FileType
    Specify what type of backup you want to create
    .PARAMETER CompressionLevel
    level of compresstion you want to use, the more compressed the more CPU will be used
    .PARAMETER BackupName
    Name of the backup file
    .NOTES
    Contact: Contact@sccmtst.com
    Version 2.0.1
    .LINK
    You can get updates to this script and others from here
    https://www.sccmtst.com/
    https://www.7-zip.org/
#>

